var people_count_weekday = [0,0,0,0,0,0,0,0,0,20,30,40,30,40,40,85,100,120,125,80,50,0,0,0];
var people_count_weekend = [0,0,0,0,0,0,0,0,0,50,50,60,70,70,80,85,100,120,150,160,100,50,0,0];

function count_people(temp, humidity, precip, people_count,time){
    if(time < 9 || time > 21) return 0;

    var people = people_count[time];
    
    /* Temperature */
    if(temp != null){
	    if (temp < 60){
	        people = people - 20;
	    }
	    else if (temp > 60 && temp < 70){     
	        people = people;
	    }
	    else if (temp > 70 && temp < 80){
	        people = people + 20;
	    }
	    else if (temp > 80 && temp < 90){
	        people = people + 20;
	    }
	    else if (temp > 90 && temp < 100){
	        people = people - 20;
	    }
    }
    
    /* Precipitation */
    if(precip != null){
	    if (precip < 30){
	        people = people;
	    }
	    else if (precip > 30 && precip < 50){   
	        people = people - 5;
	    }
	    else if (precip > 50 && precip < 70){
	        people = people - 10;   
	    }
	    else if (precip > 70){
	        people = people - 15;
	    }
    }
    
    
    /* Humidity */
    if(humidity != null){
	    if (humidity < 30){   
	        people = people;
	    }
	    if (humidity > 30 && humidity < 50){   
	        people = people;
	    }
	    else if (humidity > 50 && humidity < 80){
	        people = people - 5;
	    }
	    else if (humidity > 80){
	        people = people - 15;
	    }
    }
    return people;
}

var normalData = [];
var chartData = [];  // The data were going to use to build the chart
var temp = [];
var humidity = [];

function createData(){
	var startTime = new Date().getHours();
	_.each(temp,function(obj,idx){
		startTime++;
		startTime = startTime % 24;
		chartData.push(count_people(temp[idx], humidity[idx], null, people_count_weekday,startTime));
       	normalData.push(count_people(null,null,null,people_count_weekday,startTime));
				
	});

}
